console.log("load");
// ページ内の全ての画像要素を取得
const images = document.querySelectorAll('img');

const canvas = document.createElement('canvas');
const ctx = canvas.getContext('2d');


const family = "abea";
// const url = "https://https://mnlab.sakura.ne.jp/abe/abea.ttf";
const base64Font = 'data:font/ttf;base64,';

// const url = "chrome-extension://__MSG_@@extension_id__/abea.ttf";

var font = new FontFace(family, `url(${base64Font})`);
document.fonts.add(font);

// 各画像要素に対して処理を行う
for (const img of images) {
    canvas.width = img.width;
    canvas.height = img.height;
    ctx.drawImage(img, 0, 0);
    
    // ランダムな点を100回選択し、その点の色を取得して「A」を描画
    for (let i = 0; i < 100; i++) {
        const x = Math.floor(Math.random() * canvas.width);
        const y = Math.floor(Math.random() * canvas.height);
        const pixelData = ctx.getImageData(x, y, 1, 1).data;
        const r = pixelData[0];
        const g = pixelData[1];
        const b = pixelData[2];
        const color = `rgb(${r}, ${g}, ${b})`;

        ctx.font = '100px ' + family;
        ctx.fillStyle = color;
        ctx.fillText('A', x, y);
    }

    // 処理後の画像をページに反映
    const processedImage = new Image();
    processedImage.src = canvas.toDataURL();
    img.parentNode.replaceChild(processedImage, img);
};
